import React from 'react'
import products from '../../products'
import { Row,Col } from 'react-bootstrap'

function HomeScreen() {
  return (
    <div>
      <h1 className='text-center'>Latest Product</h1>
      <Row>
        {products.map((product)=>(
            <Col sm={12} md={6} lg={4} xl={3}>
                <h3>{product.name}</h3>
                <p>{product.image}</p>
            </Col>
        ))}
      </Row>
    </div>
  )
}

export default HomeScreen
